import React from "react";

export default function Footer() {
  //where can I find icons for github linkedin and stackoverflow?
  // https://fontawesome.com/icons?d=gallery&m=free
  // https://fontawesome.com/how-to-use/on-the-web/using-with/react

  return (
    <div>
      <footer className="bg-gray-200 text-center text-gray-700 py-4 flex-row space items-center">
        <p>
          <a
            href="https://github.com/HacAtac"
            target="_blank"
            rel="noopener noreferrer" //this is a security feature
          >
            <i className="fab fa-github justify-items-center"></i>
          </a>
          <a href="https://www.linkedin.com/in/jordan-hackworth-a8a8b9a6/">
            <i className="fab fa-linkedin"></i>
          </a>
          <a href="https://stackoverflow.com/users/16417931/jordan-hackworth">
            <i className="fab fa-stack-overflow"></i>
          </a>
        </p>
        <p>&copy; 2021 Jordan Hackworth</p>
      </footer>
    </div>
  );
}
